import java.util.Arrays;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();

        int[] arrayA = new int[n];
        int[] arrayB = new int[m];

        for (int i = 0; i < n; i++) {
            arrayA[i] = sc.nextInt();
        }

        for (int i = 0; i < m; i++) {
            arrayB[i] = sc.nextInt();
        }

        Arrays.sort(arrayA);
        Arrays.sort(arrayB);
        int i = 0;
        int j = 0;
        int count = 0;
        while (i < n && j < m) {
            if (arrayB[j] >= arrayA[i]*2 && arrayB[j] <= arrayA[i]*3) {
                count++;
                i++;
                j++;
            } else if (arrayA[i]*3 > arrayB[j]) {
                j++;
            } else {
                i++;
            }
        }
        System.out.println(count);

    }
}
